import * as React from 'react';
import { connect } from 'react-redux';

const Main: React.FC = (props: any) => {
  const [temp, setTemp] = React.useState(undefined);
  const weather = async () => {
    await fetch(
      `https://api.openweathermap.org/data/2.5/weather?zip=94040,us&appid=6cd33f76e223beefab317e542a910250`,
    )
      .then((res) => res.json())
      .then((data) => setTemp(data.main.temp));
  };
  return (
    <>
      <div className="">
        It is working
        <button onClick={weather}>Request</button>
        {temp ? temp : ''}
      </div>
      <div className="">
        <button onClick={props.add}>Show</button>
      </div>
    </>
  );
};

const mapDispatchToProps = (dispatch: any) => {
  return {
    add: () => dispatch({ type: 'SHOW_ALL' }),
  };
};

export const Maintemp = connect(null, mapDispatchToProps)(Main);
